import React from "react";
import { Link } from "react-router-dom";
import { Box, HStack, Button } from "@chakra-ui/react";

const Navbar = () => {
  return (
    <Box p={4}>
      <HStack spacing={4}>
        <Link to="/">
          <Button>Home</Button>
        </Link>
        <Link to="/about">
          <Button>About</Button>
        </Link>
        <Link to="/contact">
          <Button>Contact</Button>
        </Link>
        <Link to="/work">
          <Button>Work</Button>
        </Link>
      </HStack>
    </Box>
  );
};

export default Navbar;
